/*******************************************************************************

 $Function:     		mmi_camera_app_show_info

 $Description: 	Displays the dialog box

 $Returns: 		Dialog window

 $Arguments:		parent -parent window for dialog
 				str1- String to be displayed in dialog
 				str2 -String to be displayed in dialog
 				callback- Callback function

*******************************************************************************/
static MfwHnd mmi_camera_app_show_info(T_MFW_HND parent, int str1, int str2, T_VOID_FUNC callback)
{
	T_DISPLAY_DATA display_info;
	T_MFW_HND win;

      TRACE_FUNCTION ("mmi_camera_app_show_info()");

	/*
	** Create a timed dialog to display the Message .
	*/
	dlg_initDisplayData_TextId( &display_info, TxtNull, TxtNull, str1, str2, COLOUR_STATUS);
	dlg_initDisplayData_events( &display_info, callback, THREE_SECS, KEY_LEFT|KEY_RIGHT | KEY_CLEAR | KEY_HUP);

	win = info_dialog(parent, &display_info);
	return win;
}

/*******************************************************************************

 $Function:     mmi_camera_app_exit

 $Description:  exits a the camera application
 				
 $Returns:    None

 $Arguments:  win

*******************************************************************************/
void mmi_camera_app_exit (T_MFW_HND win)
{
	T_MFW_WIN			* win_data = ((T_MFW_HDR *) win)->data;
	T_MMI_CAM_Win_data * data = (T_MMI_CAM_Win_data *)win_data->user;

	TRACE_FUNCTION("mmi_camera_app_exit()");

	mfw_cam_delete(data->mfwwin);
	if(data->win != NULL)
	{
		winDelete (data->win);
		mfwFree((void *)data, sizeof (T_MMI_CAM_Win_data));
	}
	return;
}

