/*******************************************************************************

 $Function:		mmi_camera_filename_editor_cb

 $Description:		This function provides the callback functionality to the editor to rename the
 				default jpeg filename.

 $Returns:		None

 $Arguments:	

*******************************************************************************/
static void mmi_camera_filename_editor_cb(T_MFW_HND win, USHORT identifier, SHORT reason)
{
	T_MFW_WIN		* win_data = ((T_MFW_HDR *) win)->data;
	T_CAM_Editor_Data* dev_name_data = (T_CAM_Editor_Data *)win_data->user;
	UBYTE			* editor_buffer = NULL;
	SHORT			max_edit_size = 0;
	T_MFW_HND		parent;

    	TRACE_FUNCTION ("mmi_camera_filename_editor_cb()");

	editor_buffer = dev_name_data->cam_buffer;
	max_edit_size =CAM_FILENAME_EDITOR_INPUT_LEN;
	parent = dev_name_data->win;

	switch (reason)
	{
		case INFO_KCD_LEFT:
		{	
			//If there is no string entered, treat this as if it was a "Cancel"
			if (editor_buffer[0] == NULL)
			{
				// Send a "Cancel" to the  window
				SEND_EVENT(parent, CAM_EDITOR_CANCEL, identifier, NULL);
			}
			else
			{
				//If the file extn is not jpg, send cancel event
				// Send a "Select" to the  window
				SEND_EVENT(parent, CAM_EDITOR_SELECT, identifier, NULL);
			}
		}
		break;

		case INFO_KCD_RIGHT:
			if (strlen((char *)editor_buffer) == NULL)
			{
				//send a "Cancel" to the  window
				SEND_EVENT(parent, CAM_EDITOR_CANCEL, identifier, NULL);
			}
		break;

		case INFO_KCD_HUP:
			// Set the buffer to NULLS
			memset(editor_buffer, 0x00, max_edit_size);
			//send a "Cancel" to the   window
			SEND_EVENT(parent, CAM_EDITOR_CANCEL, identifier, NULL);
			break;

		default:
			// otherwise no action to be performed
			break;
	}
}

/*******************************************************************************

 $Function:    	mmi_camera_editor_destroy

 $Description:	Destroy the  filename editor window

 $Returns:		mfw window handle

 $Arguments:	own_window - current window

*******************************************************************************/
MfwRes mmi_camera_editor_destroy(T_MFW_HND win)
{
	T_MFW_WIN * win_data;
	T_CAM_Editor_Data * data;
			
	TRACE_FUNCTION ("mmi_camera_editor_destroy");
	if (win == NULL)
		return MfwResIllHnd;

	win_data = ((T_MFW_HDR *) win)->data;
	data = (T_CAM_Editor_Data *)win_data->user;

		// Destroy the Window

	win_delete(data->win);

       	//Free the dynamically allocated memory
	mfwFree((U8 *)data, (U16)sizeof(T_CAM_Editor_Data));

	return MfwResOk;
}

/*******************************************************************************

 $Function:    	mmi_camera_editor_cntrl

 $Description:	Exec callback function for the edit filename window

 $Returns:		none

 $Arguments:	win - current window
 				event - event id
 				value - unique id
 				parameter - optional data.
 			
*******************************************************************************/
void mmi_camera_editor_cntrl (T_MFW_HND win, USHORT event, SHORT value, void * parameter)
{
	T_MFW_WIN			* win_data = ((T_MFW_HDR *) win)->data;
	T_CAM_Editor_Data * data = (T_CAM_Editor_Data *)win_data->user;
	T_AUI_EDITOR_DATA	editor_data;
	T_MFW_HND parent_win = mfwParent(mfw_header());

	TRACE_FUNCTION ("mmi_camera_editor_cntrl");
	
	switch (event)
	{
		case CAM_EDITOR_INIT:
#ifdef NEW_EDITOR
  			TRACE_EVENT ("CAM_INIT");
                    //Clear the editor buffer
			memset(&editor_data,'\0',sizeof(editor_data));
			// copy the default name in the editor buffer
			strcpy((char *)data->cam_buffer,CAM_DEFAULT_FILENAME);
			
			// Initialise the editor
			AUI_edit_SetDefault(&editor_data);
			AUI_edit_SetBuffer(&editor_data, ATB_DCS_ASCII, data->cam_buffer, CAM_FILENAME_EDITOR_INPUT_LEN);
			AUI_edit_SetTextStr(&editor_data, TxtSoftOK, TxtDelete, TxtFilename, NULL);
			AUI_edit_SetAltTextStr(&editor_data, 1, TxtNull, TRUE, TxtSoftBack);
			AUI_edit_SetEvents(&editor_data, 0, TRUE, FOREVER, (T_AUI_EDIT_CB)mmi_camera_filename_editor_cb);
			data->cam_win_editor = AUI_edit_Start(data->win, &editor_data);
#endif
			break;

		case CAM_EDITOR_CANCEL:
  			TRACE_EVENT ("CAM_EDITOR_CANCEL");
			// Destroy the editor Window
			mmi_camera_editor_destroy(data->win);
			break;

		case CAM_EDITOR_SELECT:
  			TRACE_EVENT ("CAM_EDITOR_SELECT");
			//copy the file name from the editor
			strcpy(new_filename,(char *)data->cam_buffer);
			mmi_camera_editor_destroy(data->win);
			changedConfigs.filename=TRUE;
			mmi_camera_app_show_info(parent_win,TxtFilename,TxtSaved,NULL);		
			break;

		default:
			TRACE_EVENT ("DEFAULT"); 
			break;
	}
}

